import React
 from "react";
 const Navbar =()=>{
    return (
        <div>
            <nav className="bg-bgDark py-4">
                <h1 className="text-3xl font-bold text-center text-white"><h1>Ashish Singh</h1></h1>
            </nav>
        </div>
    )
 }
 export default Navbar;
